import Header from './components/Header';
import './App.css';
import Button from './components/Button'
import Message from './components/MessageGET';
import { useState } from 'react';


//var displayflag=false
//const data_recv=null

function GetWallet() {
  const [displayflag,setdisplayflag]= useState(false);
  const [walletid,setwalletid]= useState(null);

  const getData_id = (val) =>{
    console.log(val.target.value)
    setwalletid(parseInt(val.target.value));
  }

  var onClick = () =>{
    console.log('Click')
    setdisplayflag(true)
    console.log(displayflag)
  }
  return (
    <div className="mycontainer">
        <Header/>

        <h3>Input Niff</h3><h5> Leaving this field empy will return all wallets info</h5>
        <div><input className='input' type="text" onChange={getData_id} /> </div>

        <Button text='Get Info'  onClick={onClick}/>
        <div>     
        {
            displayflag ? <Message url='http://localhost:8000/wallet' inc_data={walletid}/> : <p></p>
        } 
        </div>

    </div>
  );
}

export default GetWallet;
